					for(var i = 1; i <= 5; ++i)
						config+='<a href="#" style="display: inline-block" class="on-off-button BPF-config '+(bpfConfig.getValue("science"+i) ? "" : "disabled")+'" config-attribute="science'+i+'">'+i+'</a>';
					config+='<hr></hr>';
